import os
import pathlib
import shutil
from pathlib import Path

import pytest
from decouple import config

from taskbridge.notes.model.note import Attachment
from test_note import TestNote

TEST_ENV = config('TEST_ENV', default='remote')


# noinspection SpellCheckingInspection
class TestAttachment:

    TEMP_FOLDER = Path("/tmp")
    LOCAL_B64 = """data:image/jpeg;base64,"""
    REMOTE_B64 = """"""

    @staticmethod
    def __create_local_attachment():
        return Attachment(
            Attachment.TYPE_IMAGE,
            "snail.jpg",
            'missing value',
            TestAttachment.LOCAL_B64,
            '1234-5678-9012.jpg'
        )

    @staticmethod
    def __create_remote_attachment():
        pathlib.Path(TestAttachment.TEMP_FOLDER / ".attachments.295").mkdir(parents=True, exist_ok=True)
        shutil.copy(TestNote.RES_DIR / '.attachments.295' / "ladybird.jpg", TestAttachment.TEMP_FOLDER / ".attachments.295/")
        return Attachment(
            Attachment.TYPE_IMAGE,
            "ladybird.jpg",
            (TestAttachment.TEMP_FOLDER / ".attachments.295" / "ladybird.jpg").absolute().as_posix()
        )

    @staticmethod
    def __create_link_attachment():
        return Attachment(
            file_type=Attachment.TYPE_LINK,
            url='https://taskbridge.app'
        )

    @staticmethod
    def __create_unsupported_attachment():
        return Attachment(
            file_type=Attachment.TYPE_UNSUPPORTED
        )

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test_save_image_to_file(self):
        att = TestAttachment.__create_local_attachment()

        # Success
        success, data = att.save_image_to_file(TestAttachment.TEMP_FOLDER)
        assert success is True

        # Fail - remote path does not exist
        success, data = att.save_image_to_file(Path("/bogus"))
        assert success is False

        # Clean up
        tmp_local = TestAttachment.TEMP_FOLDER / att.uuid
        if os.path.isfile(tmp_local):
            os.remove(tmp_local)

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test_delete_remote(self):
        att = TestAttachment.__create_remote_attachment()

        # Success
        success, data = att.delete_remote()
        assert success is True

        # Fail - invalid path
        att.url = "/bogus"
        success, data = att.delete_remote()
        assert success is False

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test_parse_local(self):
        local_note = TestNote._create_note_from_local()

        # Success - Image
        attachments = local_note.attachments
        staged_lines = TestNote.MOCK_TESTNOTE1_STAGED.splitlines()
        result = Attachment.parse_local(attachments, staged_lines, TestAttachment.TEMP_FOLDER)
        assert isinstance(result, list)
        assert len(result) == 1

        # Success - Link
        attachments_link = [TestAttachment.__create_link_attachment()]
        result = Attachment.parse_local(attachments_link, [], Path())
        assert isinstance(result[0], Attachment)
        assert result[0].file_type == Attachment.TYPE_LINK
        assert result[0].url == 'https://taskbridge.app'

        # Success - Unsupported
        attachments_unsupported = [TestAttachment.__create_unsupported_attachment()]
        result = Attachment.parse_local(attachments_unsupported, [], Path())
        assert isinstance(result[0], Attachment)
        assert result[0].file_type == Attachment.TYPE_UNSUPPORTED

        # Fail - missing image (missing b64 data)
        staged_lines.pop(10)
        success, data = Attachment.parse_local(attachments, staged_lines, TestAttachment.TEMP_FOLDER)
        assert success is False

        # Clean up
        TestNote._clean_artefacts()
        file_loc = TestAttachment.TEMP_FOLDER / attachments[0].uuid
        if os.path.isfile(file_loc):
            os.remove(file_loc)

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test_parse_remote(self):
        remote_note = TestNote._create_note_from_remote()

        # Success - Image
        result = Attachment.parse_remote(remote_note.attachments)
        assert isinstance(result, list)
        assert len(result) == 1

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test__get_local_image(self):
        # Success
        staged_lines = TestNote.MOCK_TESTNOTE1_STAGED.splitlines()
        result = Attachment._get_local_image(staged_lines, 0)
        assert result == TestAttachment.LOCAL_B64

        # Fail - wrong index
        result = Attachment._get_local_image(staged_lines, 1)
        assert result is None

    @pytest.mark.skipif(TEST_ENV != 'local', reason="Requires local filesystem.")
    def test__get_remote_image(self):
        # Success
        att = TestAttachment.__create_remote_attachment()
        result = Attachment._get_remote_image(att.url)
        assert result == TestAttachment.REMOTE_B64

        # Fail - invalid URL
        result = Attachment._get_remote_image("/bogus")
        assert result is None

        # Clean up
        TestNote._clean_artefacts()

    def test_get_supported_image_types(self):
        result = Attachment.get_supported_image_types()
        assert result == Attachment._SUPPORTED_IMAGE_TYPES

    def test_get_supported_image_types_string(self):
        result = Attachment.get_supported_image_types_string()
        assert result == '|'.join(att[1:] for att in Attachment._SUPPORTED_IMAGE_TYPES)
